Article.create(type: 'Notice', title: '第38回伊勢湾カップ2021 写真掲載のお知らせ', body: '　伊勢湾カップ2021はコロナ禍のなか皆さんのご協力で行われましたが、大会終了直後は、まだまだ感染者も多く、写真を掲載した場合、海の上ではマスクなどしていないため、いろいろな意見が出ると思い、掲載を控えておりました。
　幸いここへきて、屋外では、マスクの着用は…という風潮になってきましたので、昨年の大会で、全くクラスターなども発生していませんでしたが、遅ればせながら、表彰式の写真とともに掲載します。
　遅くなりましたことをお詫びするとともに、本年は従来のように、出艇申告や帰着申告など、リモートではない方法で行えるように準備致しています。昨年は皆さんに多大なご苦労とご面倒をおかけしたことをお詫びいたします。
　本年は3年前のような夕日を浴びての表彰式などができることを祈っています。

<p class="right aligned text">
伊勢湾カップ 大会委員長 金光秀吉
</p>', display: 'false', created_at: '2022-05-22 19:58:37 +0900', updated_at: '2022-08-07 21:30:49 +0900')
Article.create(type: 'Notice', title: '伊勢湾カップ2022に参加される皆様へ <red 駐車場のご案内>
', body: '　皆様の車を駐める方法について、本年もコロナの影響でソーシャルディスタンスを取って駐車していただくことになります。東亭東側の知多市駐車場は大変込み合いますので、<red 名鉄駐車場（橋のすぐ東側）> に多く駐車していただくようお願いをいたします。

　<red 名鉄駐車場> へは8月6日（土）朝から入っていただくことができます。熱中症を避けるために自車の中でエアコンをかけて涼んでいただくこともできる広さが十分ありますので、ぜひ<red 名鉄駐車場>に駐車していただくよう、お願いをいたします。
', display: 'false', created_at: '2022-08-01 15:17:10 +0900', updated_at: '2022-08-07 21:30:28 +0900')
Article.create(type: 'Landing', title: '<h1 class="ui center aligned h1 header mb-0">伊勢湾カップ 2022</h1>
<p class="ui center aligned h2 header mb-0">新舞子の碧い海&nbsp;<br class="mobile only">集う若人&nbsp;競う技術</p>
<p class="ui center aligned h3 header mb-0">8月6日(土)～7日(日)</p>', body: '伊勢湾カップが終わり3週間がたちました。選手やスタッフの協力のもと、コロナ感染防止対策が奏功し、感染者などは全くありませんでした。<br>
遅くなりましたが、当日の写真などをここに掲載します。なお表彰式、集合写真など、写真を撮るときのみ声を出さずにマスクを外して撮りましたことをご了承ください。<br>
また来年のシード選手は、後日発表いたします。皆様ありがとうございました。

<div class="ui right aligned container"><p>令和4年8月31日<br>伊勢湾カップ実行委員会 大会会長 金光秀吉</p></div>', display: 'true', created_at: '2022-04-13 10:34:30 +0900', updated_at: '2022-08-31 02:24:35 +0900')
Article.create(type: 'Notice', title: '伊勢湾カップ 御礼', body: '第39回伊勢湾カップ2022にご参加いただいた皆様、暑い中、また各地では豪雨被害も出ているような不安定な天候ではありましたが、幸い新舞子では、初日４~８m/秒で３レース、二日目は上空の北風とサーマルが当たってなかなか風が上がらず３～４m/秒で２レースと、予定していた５レースすべて消化することができました。二日目は、スタートライン付近で、風とは反対の押し潮で、スタートラインのコントロールに苦心されたことと思います。

今回は伊勢湾DIVで総合優勝となったのは女子１位でもある小嶺恵美さん。マスターズクラスは市川和典さん。ウィンドサーファークラスは総合で１１位に入った作野達雄さん、テクノDIVでの総合優勝は倉鹿野 巧さん、女子１位はU-15でもある大島朱莉さん、U-15１位は小山田 柊平さん、U-17１位は大島 巧己さんの皆さんがそれぞれのDIVで上位に入られました（成績表参照）

本年は早くに梅雨明けしたにもかかわらず、雨の多い時が続いたり、大会二日前までは灼熱のような高温の天気が続いたりと、知多市新舞子も通常のシーブリーズとは違った風で、特に二日目は微風軽風で、地球規模の気象の異常が感じられるような天気天候でした。

大会に参加してくださった皆様には、コロナの第７波のなか、各自、各所で感染防止対策にご協力くださり、大会本部としても心から感謝申し上げます。ありがとうございました。今回のレースに関する写真については後日の掲載を予定いたしておりますが、またここ新舞子で、シーブリーズの中、レースができるように実行委員会も誠意努力いたしますので、よろしくお願いいたします。

大会開催にあたり、地元知多市をはじめ、一般社団法人知多市観光協会、愛知県、地元地域の皆様ほか、関係の方々すべての方に改めて御礼申し上げます。ありがとうございました。

<p style="text-align: right;">大会会長　金光秀吉</p>

<a href="result.pdf" class="ui yellow button">最終成績</a>', display: 'true', created_at: '2022-08-07 09:51:45 +0900', updated_at: '2022-08-07 21:57:59 +0900')
